INSERT INTO `courses` VALUES (1,'MATEMÁTICA','La matemática evoluciona constantemente; por esta razón, tanto el aprendizaje como la enseñanza de dicho curso deben estar enfocados en el desarrollo de las destrezas necesarias para que el estudiante sea capaz de resolver problemas cotidianos, a la vez q','Mat',2,'2020-08-30 20:48:10','2020-08-31 22:46:14','1598820490_matematica.png'),(2,'COMUNICACIÓN','En el área de Comunicación tenemos el objetivo de compartir el conocimiento en base a un trinomio perfecto: Identidad – lengua – cultura, que tratamos de difundir en cada uno de los proyectos planteados y que cristalizarlos a través de la producción liter','Com',2,'2020-08-30 20:50:51','2020-08-31 22:46:26','1598820651_comunicacion.png'),(3,'CIENCIA Y TECNOLOGÍA','La ciencia para los niños debe implicar la formulación de preguntas, la generación de respuestas tentativas, la realización de investigaciones y la recolección de datos en lugar de solamente memorizar hechos.','CyT',2,'2020-08-30 20:53:30','2020-08-30 20:53:30','1598820810_ciencia.png'),(4,'PERSONAL SOCIAL','El  área personal-social  incluye las  actividades de alimentación, higiene y vestido (AVD)   y   la participación en las actividades lúdicas  o                  relacionadas al juego: individual y colectivo o social); entre otras.                - Los hi','PS',2,'2020-08-30 20:55:54','2020-08-30 20:55:54','1598820954_personal.png'),(5,'RAZONAMIENTO VERBAL','El razonamiento es el conjunto de actividades mentales que consiste en la conexión de ideas de acuerdo a ciertas reglas. En el caso del razonamiento verbal, se trata de la capacidad para razonar con contenidos verbales, estableciendo entre ellos principio','RV',2,'2020-08-30 20:57:48','2020-08-30 20:57:48','1598821068_razonamientoVerbal.png'),(6,'COMPUTACIÓN','Aprender computación para niños pretende introducirlos en el fascinante mundo de la informática. De forma divertida y práctica, irán adquiriendo habilidad experiencia en el uso del ordenador y se familiarizarán con los programas que más se adecuan a su ed','Comp',2,'2020-08-30 21:02:25','2020-08-30 21:02:25','1598821345_computacion.png'),(7,'EDUCACIÓN FÍSICA','En el área de Educación Física los niños aprenden, ejecutan y crean nuevas formas de movimiento con la ayuda de diferentes formas jugadas, lúdicas, recreativas y deportivas. En estas clases el niño puede desenvolverse, ser creativo y mostrar su espontanei','Ed. Fís.',2,'2020-08-30 21:08:14','2020-08-30 21:08:14','1598821694_ed-fisica.png'),(8,'GRAFOMOTRICIDAD','El objetivo de la grafomotricidad infantil es corregir y estimular las funciones motoras finas de los niños para que tengan un dominio completo de los movimientos y, de este modo, poder coordinar la destreza de las manos y de la vista.','Graf',2,'2020-08-30 21:11:53','2020-08-30 21:11:53','1598821913_grafomotricidad.png'),(9,'INGLÉS','La enseñanza del inglés a nuestros niños es una práctica muy beneficiosa, ya que es el momento perfecto para empezar a transmitirles información y estímulos lingüísticos, de manera que los asimilen mejor y beneficie su desarrollo cognitivo.','Ing',2,'2020-08-30 21:18:48','2020-08-30 21:18:48','1598822328_ingles.png'),(10,'MINICHEF','En el taller de Minichef, los niños pueden aprender importantes valores necesarios para su desarrollo psicológico como la responsabilidad y el valor de colaborar en las tareas de casa. Además es una buena vía para que se inicien en conocer cuáles son las ','Min',2,'2020-08-30 21:21:11','2020-08-30 21:21:11','1598822471_minichef.png'),(11,'MÚSICA','En el taller de música se fomentarán los  efectos positivos en el desarrollo cognitivo, creativo, intelectual y psicológico de los niños. Además, en este taller se estimulará el hemisferio izquierdo del cerebro, el encargado del aprendizaje del lenguaje, ','Mus',2,'2020-08-30 21:29:28','2020-08-30 21:29:28','1598822968_musica.png'),(12,'PSICOMOTRICIDAD','En el taller de psicomotricidad, el niño descubre el medio, a relacionarse, aprender, integrarse socialmente…con su cuerpo. Por ello,  hay que darle los recursos y estrategias necesarias para que favorezcan este desarrollo. Puesto que el movimiento influy','Psic',2,'2020-08-30 21:33:33','2020-08-30 21:33:33','1598823213_psicomotricidad.png'),(13,'RELIGIÓN','En el área de religión nos preocupamos por potenciar y desarrollar en la formación integral de la persona, la dimensión religiosa, espiritual y trascendente, para que, desde la perspectiva católica, les facilite una opción de fe y compromiso coherente en ','Rel',2,'2020-08-30 21:48:39','2020-08-30 21:48:39','1598824119_religion.png'),(14,'TAEKWONDO','En el taller de taekwondo fomentamos desarrollar al máximo todas las capacidades propias del cuerpo: fuerza, elasticidad, resistencia, integración, adaptación, así como un desarrollo armónico y funcional de todo su organismo.','Tkd',2,'2020-08-30 21:50:34','2020-08-30 21:50:34','1598824234_taekwondo.png'),(15,'ÁLGEBRA','El álgebra fortalece las destrezas lógicas e inicia en el pensamiento abstracto a los niños. Les hace entender que los símbolos como son la x y la y se utilizan en lugar de números que varían y que pueden utilizarse para encontrar lo faltante en problemas','Alg',2,'2020-08-30 21:55:49','2020-08-30 21:55:49','1598824549_algebra.png'),(16,'ARITMÉTICA','La aritmética es una rama de la matemática que te ayuda a realizar operaciones numéricas que solo están asociadas  problemas, sino que la utilizas en las operaciones como la suma, resta, multiplicación y división. Dichas operaciones las usas todo el tiemp','Arit',2,'2020-08-30 22:05:32','2020-08-31 23:05:52','1598915152_aritmetica.png'),(17,'GEOMETRÍA','La importancia de la geometría radica en nuestro lenguaje verbal diario posee muchos términos geométricos, por ejemplo: punto, recta, plano, curva, ángulo, paralela, círculo, cuadrado, etc. Si nosotros debemos comunicarnos con otros sobre la ubicación, el','Geo',2,'2020-08-30 22:09:50','2020-08-30 22:09:50','1598825390_geometria.png'),(18,'RAZONAMIENTO MATEMÁTICO','El razonamiento matemático es una habilidad, con la cual podemos relacionar números, comprender ecuaciones básicas, símbolos. Esta habilidad nos ayuda mucho a problemas reales en la vida cotidiana ya que es una habilidad mental y te ayuda a procesar proce','RM',2,'2020-08-30 22:12:34','2020-08-30 22:12:34','1598825554_raz-matematico.png');
